// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DoctorContract {
    struct Doctor {
        string doctorName;
        string doctorLicense;
        string doctorSpecialty;
    }

    mapping(string => Doctor) public doctors; // NID => Doctor

    function registerDoctor(
        string memory _nid,
        string memory _doctorName,
        string memory _doctorLicense,
        string memory _doctorSpecialty
    ) public {
        require(bytes(doctors[_nid].doctorName).length == 0, "Doctor already registered");

        doctors[_nid] = Doctor({
            doctorName: _doctorName,
            doctorLicense: _doctorLicense,
            doctorSpecialty: _doctorSpecialty
        });
    }

    function getDoctor(string memory _nid) public view returns (Doctor memory) {
        require(bytes(doctors[_nid].doctorName).length > 0, "Doctor not found");
        return doctors[_nid];
    }
}
